script: |
  super -f text -I q11609.spq | sort > q11609.out

inputs:
  - name: q11609.spq
    data: |
      SELECT DISTINCT + + col0 AS col1 FROM tab2 (FORMAT parquet) WHERE + - col2 + - col0 / col2 * + 38 NOT BETWEEN + CAST ( NULL AS INTEGER ) + 31 * - col0 AND - - col1;
  - name: tab2

outputs:
  - name: q11609.out
    data: |
